function addGeohashes(b, f, d, c, a, e) {
    if (geohashesGrid) {
        b.removeLayer(geohashesGrid)
    }
    var h = {_type: "terms", terms: []};
    var g = geohash.bboxes(f, d, c, a, e);

    function i(l, k) {
        h.terms.push({term: l})
    }

    g.forEach(i);
    var j = {
        recordsField: "terms",
        geohashField: "term",
        layerOptions: {fill: false, clickable: false, fillOpacity: 0, opacity: 0.3, weight: 1}
    };
    geohashesGrid = new L.GeohashDataLayer(h, j);
    b.addLayer(geohashesGrid)
};